import React from 'react';
import { useEffect, useState } from 'react';
// import { useState } from 'react';
import toast from 'react-hot-toast';
import Axios from '../axios-config';
import { useAuthUser, useIsAuthenticated } from 'react-auth-kit';
import { ProfileElements } from '../components/ProfileElements';



export const Profile = () => {

  const getUser = useAuthUser();
  const [profile, setProfile] = useState([]);
  // const [email, setEmail] = useState('');
  // const isAuth = useIsAuthenticated();

  if(!getUser) return <p className="test"> Non Connect√© </p>

  useEffect(() => {
    const fetchProfiles = async () => {
      Axios.get('/profile')
        .then(({ data }) => {
          console.log(data);
          setProfile(data.content);
        })
        .catch((err) => {
          if (err.isAxiosError) {
            toast.error(
              `Could not load profile: ${err.response?.data.message}`,
            );
          } else {
            toast.error(`Could not load profile: ${err}`);
          }
        });
    };

    fetchProfiles();
  }, []);

  return (
    <>
      <div className="test">
      <p>profile</p>
        {profile.map((profile, index) => (
          <ProfileElements profile={profile} key={'profile-${index}'} />
        ))}
      </div>
    </>
  );
};
